// eslint-disable-next-line no-unused-vars
import React from 'react';
import '../styles/home.css'; 
import {GoogleLogout } from "react-google-login";
import { useNavigate } from 'react-router-dom';

const clientId = "72464211646-0hiu8ls489tmfvm6dqcn8ut4323hrith.apps.googleusercontent.com";

const Home = () => {
  const navigate = useNavigate();

  const onFailure = (res) => {
    if(res){
      console.log('Logout Success:', res);
    }else{
      console.log('Login Failed:', res);
      navigate('/')
    }
  };

  
  return (
    <div className="home-container">
        <p>Hola Juan que deseas probar hoy?</p>
      <div className="search-bar">
        <input type="search" placeholder="Busca tu restaurante favorito" />
        <button>Buscar</button>
      </div>
      <GoogleLogout
        clientId={clientId}
        buttonText="Salir"
        onLogoutSuccess={onFailure}
      />
      <img
        src="/img/hamburguesa.png"
        alt="Imagen"
        className="home-image"
      />
      <div className="targets">
        <div className="target">Restaurante 1</div>
        <div className="target">Destino 2</div>
        <div className="target">Destino 3</div>
      </div>
    </div>
  );
};

export default Home;
